import styles from "./manset.module.scss";
import Image from "next/image";
import img from "../../../p";

export default function Manset() {
    return (
        <div  className={styles.manset}>
            <Image src={img} 
                alt="Picture of the author"
                width={500}
                height={500}
            />
        </div>
    )
}
